import React from "react";
import { Cabecalho, Titulo, ImagemLogo } from "./estiloHome";

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <Titulo>Target Music</Titulo>
        </Cabecalho>
      </header>
      <body>
      <ImagemLogo src='.\jh1_branco1.png' alt="" />
      </body>
    </div>
  );
}

export default Home;
